class ApiLibrary{

    GetThumbData = async (videoCode) => {
        
        let url = `${window.location.origin}/api/video/thumb/${videoCode}`;
        console.log(url)
        const json = await (
            await fetch(url)
        );

        console.log(json)
        json = json.json();
        console.log(json)
        json.then(
            (res)=>{ return res }
        ).finally(
            ()=>{ return null }
        )

    };
}


export default ApiLibrary;
